import React from 'react';
import MenuHeaderItem from './menuHeaderItem'
import {StyleSheet ,Text, View } from 'react-native';
import { FlatList } from 'react-native-gesture-handler';

const navbar = [
    {menuItem:<MenuHeaderItem text='Kebab' />},
    {menuItem:<MenuHeaderItem text='Pizza' />},
    {menuItem:<MenuHeaderItem text='Hamburger' />},
    {menuItem:<MenuHeaderItem text='Drinks' />},
  ];

  export default function menuHeader(props) {
    return (
      <View>
          <FlatList 
          data={navbar}
          horizontal={true}
          renderItem={(e)=>{
              return e.item.menuItem
          }}
          />
      </View>
    );
  }

